import React, { Component } from 'react';
import './video-player.scss';

class VideoPlayer extends Component {

    render () {
        return (
            <video width="320" height="240" controls>
                <source src="movie.mp4" type="video/mp4"/>
            </video>
        );
    }
}
export default VideoPlayer;
